import styles from './StreamerItemLoading.module.scss';

const StreamerItemLoading = ({name}) => {
  return(
    <div className={styles.streamer}>
        <div className={styles.profile}/>
        <h1 className={styles.name}>{name}</h1>
    </div>
  )
}

export default StreamerItemLoading
